import Banner from "./components/Banner";
import Container from "./components/Container";
import Footer from "./components/Footer";
import Header from "./components/Header";

function App() {
  return (
    <>
      <Header />
      <Banner image="favoritos" />
      <Container>
        <h2>Geografia</h2>
      </Container>
      <Footer />
    </>
  );
}

export default App;
